Cyriana''' was the name of several royal women of [[Tethyr]], including:
* Queen [[Cyriana the Great]] of the [[Bormul Dynasty]];
* Princess [[Cyriana Rhindaun]], daughter of [[Zaranda Star]]; and
* Queen [[Cyriana (queen)|Cyriana]].
